import React, { Component } from 'react';
import ReactPlayer from 'react-player';

export default class VideoQueue extends Component {
	constructor(props){
		super(props);
		this.state ={
			videoArray : ['q','w','e','r','t','y']
		}

	}

	videoList = () => {
		const list = this.state.videoArray;
		const listItems = list.map((lists, i) => {
			return <li>{lists[i]}</li>
		}
	)}
	render() {
		return (
			<div>{this.videoList}</div>
		);
	}
}
